// import logo from './logo.svg';
import './profile.css';
import React from 'react'

class Profile extends React.Component {
    render() {
        return (
                <div id="background">
                    <div id="home-page">
                        <div id="title">Indicium</div>
                            {papers.map(function(paper, index) {
                                return PaperRow({paper, index});
                            })}
                    </div>

                </div>
        )
    }
}

export default Profile;
